text:
в эпоху #metoo на уолл-стрит пересмотрели правила общения с женщинами-коллегами. теперь главное правило – избегать женщин любой ценой. более тридцати руководителей крупных финансовых компаний рассказали bloomberg о том, как изменились их личные и корпоративные стандарты поведения. вот основные правила, которые стараются соблюдать на уолл-стрит, чтобы избежать подозрений в домогательствах:
– не встречаться с женщинами-сотрудниками в комнатах без окон; – держать дистанцию в лифтах;
– не ужинать с женщиной моложе 35 лет;
– не выпивать с коллегой-женщиной после работы;
– не оставаться наедине;
– не занимать места рядом в самолете;
– в командировках селиться на разных этажах отеля. #краснодартв #новостикраснодара #уоллстрит #правила #женщины

