text:
we have an #enggirlsolutions christmas challenge for you all! 
@livgillis was shopping @winners this week and noticed the stem (science engineering technology and math) toys were mostly in the “boys” section. she corrected the situation a bit by moving the stem toy over to the #pinkaisle 
why are toys still so gendered? girls should be able to find stem toys beside dolls and pink things, and not feel like they are just “for boys”. we challenge you to #disruptthepinkaisle and move a toy you think girls should see when you are christmas shopping this season. send us a photo if you do and we will add it to our story this month. 🤶🏻👷🏾‍♀️👩🏼‍💻

